import React from 'react';


class Token extends React.Component{


  constructor(props){
    super(props);
    this.state = {
      email : "",
      password : "",
      login : false
    }

  }


  render(){
    if(this.state.login){
      return(
        <>
           from dashboard

        </>
      )
    }else{
      return(
        <>

          <form>
            <label>Email</label>
            <input 
              type = "text"
              name = "email"
              value = {this.state.password}
              onChange = {this.onChangeHandler}

            />
            <label>Password</label>
             <input 
              type = "text"
              name = "email"
              value = {this.state.password}
              onChange = {this.onChangeHandler}

            />


          </form>

        </>
      )
    }
  }
}


export default Token;
